import {
  Streamlit,
  withStreamlitConnection,
  StreamlitComponentBase
} from "streamlit-component-lib"
import React, { ReactNode} from "react"
import IconButton from '@material-ui/core/IconButton';
import ArrowForwardIosIcon from '@material-ui/icons/ArrowForwardIos';
import { styled, TextField } from "@material-ui/core"


interface State {

}

class GoTo extends StreamlitComponentBase<State> {
  public state = {}

  public render = (): ReactNode => {

    const Arrow = styled(ArrowForwardIosIcon)({})
    const FlippedArrow = styled(ArrowForwardIosIcon)({
      transform: "rotate(180deg)"
    })
    const FixedMarginIconButton = styled(IconButton)({
      marginBottom: "10px"
    })

    return (
      <div>
      <h2 style={{display:"inline", marginTop: "10px"}}>Go to index: </h2>
      <TextField
        label="Index"
        id="outlined-size-small"
        defaultValue=""
        variant="outlined"
        size="small"
        style={{marginBottom: "10px"}}
      />
      </div>
    )
  }
}

export default withStreamlitConnection(GoTo)
